import { test } from "uvu";
import * as assert from "uvu/assert";
import { makeCoreHelpers } from "../compiler/checkers/core_helpers.js";
import { sameType, typeToString } from "../compiler/checkers/helpers.js";
import { T } from "../compiler/checkers/types.js";

test("implicitReturnFromBody handles fn annotation branches", () => {
  const diags: any[] = [];
  const err = (m: string) => diags.push({ message: m });

  // resolveTypeNode returns Unit for the first case
  const coreUnit = makeCoreHelpers({ T, sameType, typeToString, resolveTypeNode: () => T.Unit, err });
  const body = { ty: T.Int, alwaysReturns: false, returnTys: [T.Int] } as any;
  const resUnit = coreUnit.implicitReturnFromBody(body, { kind: 'Unit' } as any);
  // when annotation resolves to Unit, function returns original body
  assert.is(resUnit.returnTys.length, 1);

  // resolveTypeNode returns Int for the second case
  const coreInt = makeCoreHelpers({ T, sameType, typeToString, resolveTypeNode: () => T.Int, err });
  const resInt = coreInt.implicitReturnFromBody(body, { kind: 'Int' } as any);
  assert.is(resInt.returnTys.length, 1);
});

export const coreHelpersExtra2Suite = test;

import type { Ty, BlockResult } from "./types.js";
import type { TypeNode } from "../ast.js";
import type { Span } from "../span.js";

/**
 * Factory for core checker helper functions that depend on checker state.
 * Binds `T`, `sameType`, `typeToString`, `resolveTypeNode` and `err`.
 */
/**
 * Create core helper utilities used across the checker visitors.
 *
 * These helpers are pure functions that still depend on a few pieces
 * of checker state (notably `T` and the `resolveTypeNode` function), so
 * they are produced by this factory to keep `checker.ts` concise.
 */
export function makeCoreHelpers(opts: {
  T: any;
  sameType: (a: Ty, b: Ty) => boolean;
  typeToString: (t: Ty) => string;
  resolveTypeNode: (n: TypeNode | null) => Ty;
  err: (message: string, span?: Span) => void;
}) {
  const { T, sameType, typeToString, resolveTypeNode, err } = opts;

  /** Ensure `t` matches `expected` or emit an error. */
  function mustBe(t: Ty, expected: Ty, message: string, at?: Span) {
    if (expected.kind === "Any" || expected.kind === "Unknown") return;
    if (t.kind === "Any" || t.kind === "Unknown") return;
    if (!sameType(t, expected)) err(message, at);
  }

  /**
   * Join a set of types into a single concrete type when possible.
   * Emits errors for incompatible combinations and returns `Unknown`.
   */
  function joinConcreteOrError(tys: Ty[], ctx: string, at?: Span): Ty {
    const concrete = tys.filter((t) => t.kind !== "Unknown" && t.kind !== "Any");
    if (concrete.length === 0) {
      if (tys.some((t) => t.kind === "Any")) return T.Any;
      return T.Unknown;
    }

    const hasUnit = concrete.some((t) => t.kind === "Unit");
    const hasNonUnit = concrete.some((t) => t.kind !== "Unit");
    if (hasUnit && hasNonUnit) {
      const nonUnit = concrete.find((t) => t.kind !== "Unit")!;
      err(`Incompatible types in ${ctx}: Unit and ${typeToString(nonUnit)}`, at);
      return T.Unknown;
    }

    const first = concrete[0];
    for (let i = 1; i < concrete.length; i++) {
      if (!sameType(first, concrete[i])) {
        err(
          `Incompatible types in ${ctx}: ${typeToString(first)} and ${typeToString(concrete[i])}`,
          at,
        );
        return T.Unknown;
      }
    }
    return first;
  }

  /** Emit an error if a value-producing context receives `Unit`. */
  function requireValue(ty: Ty, what: string, at?: Span) {
    if (ty.kind === "Unit") err(`${what} must produce a value`, at);
  }

  /** Emit an error if a branch-producing context receives `Unit`. */
  function requireBranchValue(ty: Ty, what: string, at?: Span) {
    if (ty.kind === "Unit") err(`${what} must produce a value`, at);
  }

  /**
   * When a function has no explicit return annotation, include the
   * implicit final expression as a potential return value.
   */
  function implicitReturnFromBody(
    body: BlockResult,
    fnRetAnn: TypeNode | null,
    at?: Span,
  ): BlockResult {
    if (fnRetAnn) {
      const annTy = resolveTypeNode(fnRetAnn);
      if (annTy.kind === "Unit") {
        return body;
      }
      return body;
    }

    if (!body.alwaysReturns) {
      if (body.ty.kind !== "Unit") {
        return {
          ty: body.ty,
          alwaysReturns: false,
          returnTys: [...body.returnTys, body.ty],
        };
      }

      return {
        ty: body.ty,
        alwaysReturns: false,
        returnTys: [...body.returnTys, T.Unit],
      };
    }

    return body;
  }

  return { mustBe, joinConcreteOrError, requireValue, requireBranchValue, implicitReturnFromBody };
}

import type { Ty } from "./types.js";

/**
 * Check structural type equality used by the checker.
 *
 * This treats `Any` and `Unknown` as matching anything to avoid
 * noisy errors during incremental inference.
 */
export function sameType(a: Ty, b: Ty): boolean {
  if (a.kind === "Any" || b.kind === "Any") return true;
  if (a.kind === "Unknown" || b.kind === "Unknown") return true;
  if (a.kind !== b.kind) return false;

  if (a.kind === "Struct" || a.kind === "Enum")
    return a.name === (b as any).name;

  if (a.kind === "Fn") {
    const fb = b as any as Ty & { kind: "Fn" };
    if (a.params.length !== fb.params.length) return false;
    if (!sameType(a.ret, fb.ret)) return false;
    for (let i = 0; i < a.params.length; i++) {
      if (!sameType(a.params[i], fb.params[i])) return false;
    }
    return true;
  }
  return true;
}

/**
 * Format a `Ty` into a human readable string for diagnostics.
 *
 * Examples: `Int`, `Struct(Point)`, `fn(Int)->Unit`.
 */
export function typeToString(t: Ty): string {
  switch (t.kind) {
    case "Struct":
    case "Enum":
      return `${t.kind}(${t.name})`;
    case "Fn":
      return `fn(${t.params.map(typeToString).join(", ")})->${typeToString(t.ret)}`;
    default:
      return t.kind;
  }
}

/**
 * Return true for types that can be used in boolean contexts
 * (includes `Any` and `Unknown` to avoid cascading errors).
 */
export function isBoolish(t: Ty): boolean {
  return t.kind === "Bool" || t.kind === "Any" || t.kind === "Unknown";
}

/**
 * Quick check whether an expression node is effectful (may produce
 * control flow or side effects). Used to validate expression statements.
 */
export function isEffectfulExpr(e: { type: string }): boolean {
  return (
    e.type === "CallExpr" ||
    e.type === "IfExpr" ||
    e.type === "MatchExpr" ||
    e.type === "Block"
  );
}

import type { TypeNode } from "../ast.js";

/** Information about a struct's fields and their annotated types. */
export type StructInfo = { fields: Map<string, TypeNode | null> };

/** Information about an enum's variants and optional payload types. */
export type EnumInfo = {
  variants: Map<
    string,
    { payloadField: string | null; payloadType: TypeNode | null }
  >;
};

/** Runtime representation of types used by the checker. */
export type Ty =
  | { kind: "Int" }
  | { kind: "Bool" }
  | { kind: "String" }
  | { kind: "Unit" }
  | { kind: "Any" }
  | { kind: "Unknown" }
  | { kind: "Struct"; name: string }
  | { kind: "Enum"; name: string }
  | { kind: "Fn"; params: Ty[]; ret: Ty };

/** Convenient constants/constructors for `Ty`. */
export const T = {
  Int: { kind: "Int" } as Ty,
  Bool: { kind: "Bool" } as Ty,
  String: { kind: "String" } as Ty,
  Unit: { kind: "Unit" } as Ty,
  Any: { kind: "Any" } as Ty,
  Unknown: { kind: "Unknown" } as Ty,
  Struct: (name: string): Ty => ({ kind: "Struct", name }),
  Enum: (name: string): Ty => ({ kind: "Enum", name }),
  Fn: (params: Ty[], ret: Ty): Ty => ({ kind: "Fn", params, ret }),
};

/** Metadata for variables in a scope. */
export type ScopeEntry = {
  used: boolean;
  ty: Ty;
  isTopLevel: boolean;
  isExported: boolean;
};

/** Map of identifier -> metadata for a single lexical scope. */
export type Scope = Map<string, ScopeEntry>;

export type StmtResult = {
  alwaysReturns: boolean;
  returnTy: Ty | null;
  exprTy: Ty | null;
};

export type BlockResult = {
  ty: Ty;
  alwaysReturns: boolean;
  returnTys: Ty[];
};

import { test } from "uvu";
import * as assert from "uvu/assert";
import { makeExprVisitor } from "../compiler/checkers/expr.js";
import { makeCoreHelpers } from "../compiler/checkers/core_helpers.js";
import { sameType, typeToString, isBoolish } from "../compiler/checkers/helpers.js";
import { T } from "../compiler/checkers/types.js";

test("Enum literal edge cases: unknown enum/variant/payload mistakes", () => {
  const diags: any[] = [];
  const err = (m: string) => diags.push({ message: m });

  const enums = new Map();
  enums.set("E", { variants: new Map([["A", { payloadField: null, payloadType: null }], ["B", { payloadField: 'x', payloadType: { kind: 'Int' } }]]) });

  const core = makeCoreHelpers({ T, sameType, typeToString, resolveTypeNode: (n:any) => (n ? T.Int : T.Unit), err });

  const visitor = makeExprVisitor({
    use: () => T.Int,
    T,
    sameType,
    typeToString,
    isBoolish,
    joinConcreteOrError: core.joinConcreteOrError,
    requireValue: core.requireValue,
    requireBranchValue: core.requireBranchValue,
    resolveTypeNode: (n:any) => (n && n.kind === 'Int' ? T.Int : T.Unit),
    declare: () => {},
    envEnumOfIdent: new Map(),
    structs: new Map(),
    enums,
    visitBlock: () => ({ ty: T.Int, alwaysReturns: false }),
    visitMatch: () => ({ ty: T.Int }),
    mustBe: core.mustBe,
    err,
    spanOf: () => undefined,
  });

  // Unknown enum
  visitor({ type: 'EnumLiteral', enumName: 'X', variant: 'A', payload: { type: 'IntLiteral' } } as any, [new Map()], false, null);

  // Unknown variant
  visitor({ type: 'EnumLiteral', enumName: 'E', variant: 'C', payload: { type: 'IntLiteral' } } as any, [new Map()], false, null);

  // Variant takes no arguments but payload provided
  visitor({ type: 'EnumLiteral', enumName: 'E', variant: 'A', payload: { type: 'IntLiteral' } } as any, [new Map()], false, null);

  // Variant expects payload but none provided
  visitor({ type: 'EnumLiteral', enumName: 'E', variant: 'B', payload: null } as any, [new Map()], false, null);

  // Payload type mismatch (simulate by providing StringLiteral)
  visitor({ type: 'EnumLiteral', enumName: 'E', variant: 'B', payload: { type: 'StringLiteral' } } as any, [new Map()], false, null);

  assert.ok(true);
});

export const exprEnumMore2Suite = test;

import type { Expression, Block, MatchExpr } from "../ast.js";
import type { Scope, Ty } from "./types.js";
import type { Span } from "../span.js";

/**
 * Create an expression visitor bound to the provided checker helpers.
 * The returned function has the same shape as the original `visitExpr`.
 */
/**
 * Create an expression visitor bound to the provided checker helpers.
 *
 * The returned `visitExpr` function mirrors the original implementation
 * in `checker.ts` but is isolated for readability and testing.
 */
export function makeExprVisitor(opts: {
  use: (stack: Scope[], name: string, at?: Span) => Ty;
  T: any;
  sameType: (a: Ty, b: Ty) => boolean;
  typeToString: (t: Ty) => string;
  isBoolish: (t: Ty) => boolean;
  joinConcreteOrError: (tys: Ty[], ctx: string, at?: Span) => Ty;
  requireValue: (ty: Ty, what: string, at?: Span) => void;
  requireBranchValue: (ty: Ty, what: string, at?: Span) => void;
  resolveTypeNode: (n: any) => Ty;
  declare: (scope: Scope, name: string, ty: Ty, opts?: any) => void;
  envEnumOfIdent: Map<string, string>;
  structs: Map<string, any>;
  enums: Map<string, any>;
  visitBlock: (b: Block, stack: Scope[], inFn: boolean, expectedFnRet: Ty | null, valueContext: boolean) => { ty: Ty; alwaysReturns: boolean; };
  visitMatch: (m: MatchExpr, stack: Scope[], inFn: boolean, expectedFnRet: Ty | null, valueContext: boolean) => { ty: Ty };
  mustBe?: (a: Ty, b: Ty, message: string, at?: Span) => void;
  err: (message: string, span?: Span) => void;
  spanOf: (n: any) => Span | undefined;
}) {
  const { T, sameType, typeToString } = opts;

  return function visitExpr(
    e: Expression,
    stack: Scope[],
    inFn: boolean,
    expectedFnRet: Ty | null,
  ): { ty: Ty; alwaysReturns: boolean } {
    switch (e.type) {
      case "Identifier":
        return { ty: opts.use(stack, e.name, opts.spanOf(e)), alwaysReturns: false };

      case "IntLiteral":
        return { ty: T.Int, alwaysReturns: false };

      case "BoolLiteral":
        return { ty: T.Bool, alwaysReturns: false };

      case "StringLiteral":
        return { ty: T.String, alwaysReturns: false };

      case "InterpString": {
        for (const p of e.parts) {
          if (p.type === "Expr") {
            const pr = visitExpr(p.expr, stack, inFn, expectedFnRet);
            opts.requireValue(pr.ty, "Interpolation", opts.spanOf(p.expr));
          }
        }
        return { ty: T.String, alwaysReturns: false };
      }

      case "UnaryExpr": {
        const ot = visitExpr(e.operand, stack, inFn, expectedFnRet).ty;
        if (e.operator === "!") {
          if (!opts.isBoolish(ot)) opts.err(`Operator '!' expects Bool`, opts.spanOf(e));
          return { ty: T.Bool, alwaysReturns: false };
        }
        return { ty: T.Unknown, alwaysReturns: false };
      }

      case "BinaryExpr": {
        const lt = visitExpr(e.left, stack, inFn, expectedFnRet).ty;
        const rt = visitExpr(e.right, stack, inFn, expectedFnRet).ty;

        if (["+", "-", "*", "/"].includes(e.operator)) {
          if (lt.kind !== "Int" && lt.kind !== "Any" && lt.kind !== "Unknown")
            opts.err(`Operator '${e.operator}' expects Int`, opts.spanOf(e.left));
          if (rt.kind !== "Int" && rt.kind !== "Any" && rt.kind !== "Unknown")
            opts.err(`Operator '${e.operator}' expects Int`, opts.spanOf(e.right));
          return { ty: T.Int, alwaysReturns: false };
        }

        if (["<", "<=", ">", ">="].includes(e.operator)) {
          if (lt.kind !== "Int" && lt.kind !== "Any" && lt.kind !== "Unknown")
            opts.err(`Operator '${e.operator}' expects Int`, opts.spanOf(e.left));
          if (rt.kind !== "Int" && rt.kind !== "Any" && rt.kind !== "Unknown")
            opts.err(`Operator '${e.operator}' expects Int`, opts.spanOf(e.right));
          return { ty: T.Bool, alwaysReturns: false };
        }

        if (e.operator === "==" || e.operator === "!=") {
          if (
            lt.kind !== "Any" &&
            lt.kind !== "Unknown" &&
            rt.kind !== "Any" &&
            rt.kind !== "Unknown" &&
            !sameType(lt, rt)
          ) {
            opts.err(
              `Cannot compare ${typeToString(lt)} and ${typeToString(rt)} with '${e.operator}'`,
              opts.spanOf(e),
            );
          }
          return { ty: T.Bool, alwaysReturns: false };
        }

        if (e.operator === "&&" || e.operator === "||") {
          if (!opts.isBoolish(lt))
            opts.err(`Operator '${e.operator}' expects Bool`, opts.spanOf(e.left));
          if (!opts.isBoolish(rt))
            opts.err(`Operator '${e.operator}' expects Bool`, opts.spanOf(e.right));
          return { ty: T.Bool, alwaysReturns: false };
        }

        return { ty: T.Unknown, alwaysReturns: false };
      }

      case "CallExpr": {
        const calleeTy = visitExpr(e.callee, stack, inFn, expectedFnRet).ty;
        const argTys = e.args.map((a) => visitExpr(a, stack, inFn, expectedFnRet).ty);

        if (calleeTy.kind !== "Fn") {
          opts.err(
            `Cannot call non-function of type ${typeToString(calleeTy)}`,
            opts.spanOf(e),
          );
          return { ty: T.Unknown, alwaysReturns: false };
        }

        if (argTys.length !== calleeTy.params.length) {
          opts.err(
            `Wrong number of arguments: expected ${calleeTy.params.length}, got ${argTys.length}`,
            opts.spanOf(e),
          );
          return { ty: calleeTy.ret, alwaysReturns: false };
        }

        for (let i = 0; i < argTys.length; i++) {
          const expected = calleeTy.params[i];
          const got = argTys[i];

          if (
            expected.kind !== "Any" &&
            expected.kind !== "Unknown" &&
            got.kind !== "Any" &&
            got.kind !== "Unknown" &&
            !sameType(expected, got)
          ) {
            opts.err(
              `Argument ${i + 1} type mismatch: expected ${typeToString(expected)}, got ${typeToString(got)}`,
              opts.spanOf(e.args[i]),
            );
          }
        }

        return { ty: calleeTy.ret, alwaysReturns: false };
      }

      case "IfExpr": {
        if (e.init) {
          const initRes = visitExpr(e.init.initializer, stack, inFn, expectedFnRet);
          opts.requireValue(initRes.ty, "Initializer", opts.spanOf(e.init.initializer));

          const annTy = opts.resolveTypeNode(e.init.typeAnn);

          if (e.init.typeAnn) {
            opts.mustBe && opts.mustBe(
              initRes.ty,
              annTy,
              `Type mismatch in '${e.init.name}': expected ${typeToString(annTy)}, got ${typeToString(initRes.ty)}`,
              opts.spanOf(e.init),
            );
          }

          const effective = e.init.typeAnn ? annTy : initRes.ty;

          opts.declare(stack[stack.length - 1], e.init.name, effective, {
            used: false,
            isTopLevel: false,
            isExported: false,
          });

          if (e.init.initializer.type === "EnumLiteral") {
            opts.envEnumOfIdent.set(e.init.name, e.init.initializer.enumName);
          }
        }

        const ct = visitExpr(e.condition, stack, inFn, expectedFnRet).ty;
        if (!opts.isBoolish(ct)) opts.err(`If condition must be Bool`, opts.spanOf(e.condition));

        const thenRes = opts.visitBlock(e.thenBranch, stack, inFn, expectedFnRet, true);
        const thenTy = thenRes.ty;
        opts.requireBranchValue(thenTy, "If branch", opts.spanOf(e.thenBranch));

        let elseTy: Ty;
        let elseAlwaysReturns: boolean;

        if (e.elseBranch.type === "IfExpr") {
          const elseIfRes = visitExpr(e.elseBranch, stack, inFn, expectedFnRet);
          elseTy = elseIfRes.ty;
          elseAlwaysReturns = elseIfRes.alwaysReturns;
          opts.requireBranchValue(elseTy, "If branch", opts.spanOf(e.elseBranch));
        } else {
          const elseRes = opts.visitBlock(e.elseBranch, stack, inFn, expectedFnRet, true);
          elseTy = elseRes.ty;
          elseAlwaysReturns = elseRes.alwaysReturns;
          opts.requireBranchValue(elseTy, "If branch", opts.spanOf(e.elseBranch));
        }

        const joined = opts.joinConcreteOrError([thenTy, elseTy], "if branches", opts.spanOf(e));
        opts.requireValue(joined, "If expression", opts.spanOf(e));

        return { ty: joined, alwaysReturns: thenRes.alwaysReturns && elseAlwaysReturns };
      }

      case "StructLiteral": {
        const info = opts.structs.get(e.name);
        if (!info) {
          opts.err(`Unknown struct: ${e.name}`, opts.spanOf(e));
          for (const f of e.fields) visitExpr(f.value, stack, inFn, expectedFnRet);
          return { ty: T.Unknown, alwaysReturns: false };
        }

        const def = info.fields;
        const seen = new Set<string>();

        for (const f of e.fields) {
          if (!def.has(f.name)) opts.err(`Unknown field '${f.name}' in ${e.name}`, opts.spanOf(f));
          if (seen.has(f.name)) opts.err(`Duplicate field '${f.name}' in ${e.name}`, opts.spanOf(f));
          seen.add(f.name);

          const valTy = visitExpr(f.value, stack, inFn, expectedFnRet).ty;
          opts.requireValue(valTy, `Field '${e.name}.${f.name}'`, opts.spanOf(f.value));

          const fieldAnn = def.get(f.name) ?? null;
          const fieldTy = opts.resolveTypeNode(fieldAnn);

          if (fieldAnn) {
            opts.mustBe && opts.mustBe(
              valTy,
              fieldTy,
              `Type mismatch for field '${e.name}.${f.name}': expected ${typeToString(fieldTy)}, got ${typeToString(valTy)}`,
              opts.spanOf(f.value),
            );
          }
        }

        for (const req of def.keys()) {
          if (!seen.has(req)) opts.err(`Missing field '${req}' in ${e.name}`, opts.spanOf(e));
        }

        return { ty: T.Struct(e.name), alwaysReturns: false };
      }

      case "StructUpdateExpr": {
        const targetRes = visitExpr(e.target, stack, inFn, expectedFnRet);
        const targetTy = targetRes.ty;

        if (targetTy.kind !== "Struct") {
          opts.err(`Cannot update non-struct type ${typeToString(targetTy)}`, opts.spanOf(e));
          for (const f of e.fields) visitExpr(f.value, stack, inFn, expectedFnRet);
          return { ty: T.Unknown, alwaysReturns: false };
        }

        const info = opts.structs.get(targetTy.name);
        if (!info) {
          opts.err(`Unknown struct: ${targetTy.name}`, opts.spanOf(e));
          return { ty: T.Unknown, alwaysReturns: false };
        }

        const def = info.fields;
        const seen = new Set<string>();

        for (const f of e.fields) {
          if (!def.has(f.name)) opts.err(`Unknown field '${f.name}' in ${targetTy.name}`, opts.spanOf(f));
          if (seen.has(f.name)) opts.err(`Duplicate field '${f.name}' in ${targetTy.name}`, opts.spanOf(f));
          seen.add(f.name);

          const valTy = visitExpr(f.value, stack, inFn, expectedFnRet).ty;
          const fieldAnn = def.get(f.name) ?? null;
          const fieldTy = opts.resolveTypeNode(fieldAnn);

          if (fieldAnn) {
            opts.mustBe && opts.mustBe(
              valTy,
              fieldTy,
              `Type mismatch for field '${targetTy.name}.${f.name}': expected ${typeToString(fieldTy)}, got ${typeToString(valTy)}`,
              opts.spanOf(f.value),
            );
          }
        }

        return { ty: T.Struct(targetTy.name), alwaysReturns: false };
      }

      case "EnumLiteral": {
        const info = opts.enums.get(e.enumName);
        if (!info) {
          opts.err(`Unknown enum: ${e.enumName}`, opts.spanOf(e));
          if (e.payload) visitExpr(e.payload, stack, inFn, expectedFnRet);
          return { ty: T.Unknown, alwaysReturns: false };
        }

        const v = info.variants.get(e.variant);
        if (!v) {
          opts.err(`Unknown variant '${e.variant}' in ${e.enumName}`, opts.spanOf(e));
          if (e.payload) visitExpr(e.payload, stack, inFn, expectedFnRet);
          return { ty: T.Enum(e.enumName), alwaysReturns: false };
        }

        if (v.payloadField === null && e.payload !== null) opts.err(`${e.variant} takes no arguments`, opts.spanOf(e));
        if (v.payloadField !== null && e.payload === null) opts.err(`${e.variant} expects 1 argument`, opts.spanOf(e));

        if (e.payload) {
          const pt = visitExpr(e.payload, stack, inFn, expectedFnRet).ty;
          opts.requireValue(pt, "Enum payload", opts.spanOf(e.payload));

          const expected = opts.resolveTypeNode(v.payloadType);
          if (v.payloadType) {
            opts.mustBe && opts.mustBe(
              pt,
              expected,
              `Enum payload type mismatch for ${e.enumName}.${e.variant}: expected ${typeToString(expected)}, got ${typeToString(pt)}`,
              opts.spanOf(e.payload),
            );
          }
        }

        return { ty: T.Enum(e.enumName), alwaysReturns: false };
      }

      case "MatchExpr": {
        const res = opts.visitMatch(e, stack, inFn, expectedFnRet, true);
        opts.requireValue(res.ty, "Match expression", opts.spanOf(e));
        return { ty: res.ty, alwaysReturns: false };
      }

      case "Block": {
        const res = opts.visitBlock(e, stack, inFn, expectedFnRet, true);
        return { ty: res.ty, alwaysReturns: res.alwaysReturns };
      }
    }
  };
}

